  return (
    
    <div style={{backgroundColor:"#ffba42"}}>
      <div className="financial">
      <h1>Finance</h1>
      </div>
      <FinancialRecords />
      <OrderManagement />
      <FinancialReports />
      <div class="footer">
      <p>Footer</p>
      </div>
    </div>
  );
}

export default FinancialApp;
